import React from 'react'
import DefaultHeader from './../Header/header'
import LoginPage from '../login/login';


export default class HomePage extends React.Component{
    render(){
        return(
            <div>
            <DefaultHeader/>
            <LoginPage/>
                <div>菜单栏组件</div>
                <div>
                    首页内容
                </div>
            </div>
        )
    }
}
